import React from 'react';
import ImageItem from '../imageItem.js';


export default class ImageList extends React.Component {
    render() {
        return (
            <>
                {this.props.images.map((image) => {

                return <ImageItem 
                    key={image.title}
                    image={image}/>})}
            </>
        )
    }
}
